import React from "react";
import { FooterLinks, Icons } from "./Constants";
import {
  FooterBlock,
  FooterContent,
  FooterLink,
  FooterListWrapper,
  NameLi,
  Li,
  FooterIcon
} from "./FooterFragments";

const InnnerLi = props =>
  props.item.links.map((link, index) => (
    <Li key={index}>
      {!props.icon ? (
        <FooterLink href={link.href} inactive={link.inactive}>
          {link.name}
        </FooterLink>
      ) : (
        <FooterIcon
          country={props.item.country}
          inactive={link.inactive}
          href={link.href}
          url={link.url}
        />
      )}
    </Li>
  ));
const FooterLinkComponent = props => {
  return props.links.map((item, index) => (
    <FooterListWrapper key={index}>
      <ul className="text-left align-top">
        <NameLi> {item.name} </NameLi>
        {props.lowerFooter
          ? item.lowerFooter && <InnnerLi item={item} icon={props.icon} />
          : null}
        {!props.lowerFooter
          ? !item.lowerFooter && <InnnerLi item={item} icon={props.icon} />
          : null}
      </ul>
    </FooterListWrapper>
  ));
};

const FooterComponent = props => (
  <FooterBlock>
    <FooterContent>
      <FooterLinkComponent
        links={FooterLinks}
        lowerFooter={props.lowerFooter}
        icon={false}
      />
      <FooterLinkComponent
        links={Icons}
        lowerFooter={props.lowerFooter}
        icon={true}
      />
    </FooterContent>
  </FooterBlock>
);

export default FooterComponent;
